import React from "react";

const VideoCard = ({
  video,
  user,
  onVote,
  onEditLink,
  editingVideo,
  tempLink,
  setTempLink,
  onSaveLink,
  onCancelEdit,
}) => {
  const hasVoted = video.voters.includes(user.name);
  const canVote = user.votesRemaining > 0 && !hasVoted;

  const handleVote = () => {
    if (canVote) {
      onVote(video.id);
    }
  };

  const handleLinkClick = (e) => {
    if (video.link && !editingVideo) {
      e.preventDefault();
      window.open(video.link, "_blank");
    }
  };

  return (
    <div
      className={`bg-white rounded-lg shadow-md hover:shadow-lg transition-all duration-200 ${
        hasVoted ? "ring-2 ring-green-500 bg-green-50" : ""
      } ${canVote ? "cursor-pointer hover:scale-105" : ""}`}
    >
      <div className="p-6">
        {/* Video Header */}
        <div className="flex justify-between items-start mb-4">
          <h3 className="text-lg font-semibold text-gray-900">{video.name}</h3>
          <span className="text-sm text-gray-500">#{video.id}</span>
        </div>

        {/* Video Link Section */}
        <div className="mb-4">
          {editingVideo === video.id ? (
            <div className="space-y-2">
              <input
                type="url"
                value={tempLink}
                onChange={(e) => setTempLink(e.target.value)}
                placeholder="Enter video URL"
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500 focus:border-transparent outline-none text-sm"
              />
              <div className="flex space-x-2">
                <button
                  onClick={onSaveLink}
                  className="px-3 py-1 bg-green-600 text-white text-sm rounded hover:bg-green-700 transition-colors"
                >
                  Save
                </button>
                <button
                  onClick={onCancelEdit}
                  className="px-3 py-1 bg-gray-600 text-white text-sm rounded hover:bg-gray-700 transition-colors"
                >
                  Cancel
                </button>
              </div>
            </div>
          ) : (
            <div className="space-y-2">
              {video.link ? (
                <a
                  href={video.link}
                  onClick={handleLinkClick}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-blue-600 hover:text-blue-800 text-sm break-all underline"
                >
                  {video.link.length > 40
                    ? `${video.link.substring(0, 40)}...`
                    : video.link}
                </a>
              ) : (
                <p className="text-gray-400 text-sm italic">
                  No link added yet
                </p>
              )}
              <button
                onClick={() => onEditLink(video)}
                className="text-xs text-blue-600 hover:text-blue-800 underline"
              >
                Edit Link
              </button>
            </div>
          )}
        </div>

        {/* Vote Button */}
        <div className="mb-4">
          <button
            onClick={handleVote}
            disabled={!canVote}
            className={`w-full py-2 px-4 rounded-md font-medium transition-all ${
              hasVoted
                ? "bg-green-100 text-green-800 border border-green-300"
                : canVote
                ? "bg-blue-600 text-white hover:bg-blue-700"
                : "bg-gray-300 text-gray-500 cursor-not-allowed"
            }`}
          >
            {hasVoted ? "✓ Voted" : canVote ? "Vote" : "No votes left"}
          </button>
        </div>

        {/* Vote Count */}
        <div className="text-center mb-3">
          <span className="text-2xl font-bold text-gray-700">
            {video.votes}
          </span>
          <span className="text-sm text-gray-500 ml-1">votes</span>
        </div>

        {/* Voters List */}
        {video.voters.length > 0 && (
          <div className="border-t pt-3">
            <p className="text-xs text-gray-500 mb-2">Voted by:</p>
            <div className="flex flex-wrap gap-1">
              {video.voters.map((voter, index) => (
                <span
                  key={index}
                  className={`inline-block px-2 py-1 rounded-full text-xs ${
                    voter === user.name
                      ? "bg-blue-100 text-blue-800 font-medium"
                      : "bg-gray-100 text-gray-700"
                  }`}
                >
                  {voter}
                </span>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default VideoCard;
